  \"2015-09-26T23:25:06.495279\",\n\t\"name\": \"temperature-salinity-and-other-variables-collected-from-discrete-sample-and-profile-observation0b655\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0116063 includes chemical,
  discrete sample, physical and profile data collected from NATHANIEL B. PALMER in
  the South Pacific Ocean from 1996-08-30 to 1996-09-24 and retrieved during cruise
  NBP-9604 and Ross_Sea_320619960830. These data include AMMONIUM, DELTA CARBON-13,
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect
  these data include CTD and bottle. These data were collected by R Anderson of Columbia
  University; Lamont-Doherty Earth Observatory and L. Codispoti of University of Maryland;
  Center for Environmental Science; Horn Point Laboratory as part of the CLIVAR_Ross_Sea_320619960830
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"license_title\": null,\n\t\"extras\":
